import { Link as RouterLink } from 'react-router-dom';
import { Box } from '@mui/material';
import {INDEX} from "../../configs";
import {styled} from "@mui/material/styles";

const icon = (
  <svg
    version="1.1"
    id="Layer_1"
    xmlns="http://www.w3.org/2000/svg"
    xmlnsXlink="http://www.w3.org/1999/xlink"
    x="0px"
    y="0px"
    width="100%"
    height="100%"
    viewBox="0 0 512 512"
    enableBackground="new 0 0 512 512"
    xmlSpace="preserve"
  >
    <image
      id="image0"
      width="100%"
      height="100%"
      x="0"
      y="0"
      href="data:image/png;base64," />
  </svg>
)


const RootStyle = styled(Box)({
  width: 40,
  height: 40
})

const Icon = (props) => {
  return (
    <RootStyle {...props}>
      {icon}
    </RootStyle>
  )
}

const Logo = ({ disabledLink = false, ...props }) => {
  if (disabledLink) {
    return <><Icon {...props}/></>;
  }

  return <RouterLink to={INDEX}><Icon {...props}/></RouterLink>;
}

export default Logo;
